export default function DateTimeToString(date) {
    let options = {
        year: 'numeric',
        month: '2-digit',
        day: '2-digit',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit'
    }
    let newDate = new Date(date);
    let stringDate = newDate.getFullYear() + "-" + (To2digit(newDate.getMonth() + 1)) +
        "-" + To2digit(newDate.getDay()) + "T" + To2digit(newDate.getHours()) + ":" + To2digit(newDate.getMinutes());
    return stringDate == 'Invalid Date' ? '' : stringDate;
}

function To2digit(num) {
    if (num >= 0 && num <= 9) {
        return '0' + num;
    }
    return num;
}
